import './Home.css';

function Home() {
  return (
    <div>
      <div className="navbar">
          <div className="navbar-top">
              <img src="Hi-ish.svg"/>
          </div>
          <div className="navbar-mid">
              <img src="Hi-ish.svg"/>
          </div>
          <div className="navbar-btm">
              <div>
                  <img src="plus.gif"/>
                  <img src="search.gif"/>
              </div>
          </div>
      </div>
    </div>
  );
}

export default Home;
